// 测试localStorage中的技能数据
console.log('检查localStorage中的技能数据:');
const savedSkills = localStorage.getItem('skills');
console.log('原始数据:', savedSkills);

if (savedSkills) {
  try {
    const skills = JSON.parse(savedSkills);
    console.log('解析后的数据:', skills);
    console.log('技能数量:', skills.length);
    if (skills.length > 0) {
      console.log('第一个技能:', skills[0]);
    }
  } catch (e) {
    console.error('解析数据出错:', e);
  }
} else {
  console.log('没有找到技能数据');
}

// 如果没有数据，可以添加一些测试数据
if (!savedSkills || JSON.parse(savedSkills).length === 0) {
  const testSkills = [
    {
      id: Date.now(),
      name: '测试技能1',
      hoursPracticed: 100,
      targetHours: 10000,
      createdAt: new Date().toISOString()
    },
    {
      id: Date.now() + 1,
      name: '测试技能2',
      hoursPracticed: 500,
      targetHours: 10000,
      createdAt: new Date().toISOString()
    }
  ];
  localStorage.setItem('skills', JSON.stringify(testSkills));
  console.log('已添加测试数据:', testSkills);
}
